import React from 'react';
import './bar.css';
import Globe from './Icons/Globe';
import Icon1 from './Icons/Icon1';
import Icon2 from './Icons/Icon2';
import Icon3 from './Icons/Icon3';
import Icon4 from './Icons/Icon4';
import Icon5 from './Icons/Icon5';
import Group from './Icons/Group';
import Icon6 from './Icons/Icon6';
import Icon7 from './Icons/Icon7';
import Icon8 from './Icons/Icon8';
import Group294 from './Icons/Group294';
import Icon9 from './Icons/Icon9';

function Bar() {
  return ( 
    
  <nav className="navbar navbar-expand-lg   " id='sticky1'>
  <div className="container-fluid " >
    
    {/* <a className="navbar-brand " >
    <span>
    <span className='group'><Group/></span>
    <span className='text'><h3>Pods</h3></span>
    </span>
    </a> */}
    {/* <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button> */}
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item">
          <a className="nav-link " href="#/Popular">
          <span>
          <span className='icon7'><Icon7/></span>
          <span ><h3>All pods</h3></span>
          </span>
          </a>
        </li>
        <li className="nav-item">
          <a className="nav-link icon6" href="#/Toprated"><Icon6/></a>
        </li>
        <li className="nav-item">
          <a className="nav-link group294" href="#/Upcoming"><Group294/></a>
        </li>
        <li className="nav-item">
          <a className="nav-link icon8" href="#/Upcoming"><Icon8/></a>
        </li>
        <li className="nav-item">
          <a className="nav-link icon9" href="#/Upcoming"><Icon9/></a>
        </li>       
      </ul>
    </div>
  </div>
  </nav>
  

  )
   
  
}

export default Bar;
